import React, { useEffect, useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import App1 from "./components/App1";
import Login from "./components/Login";
import Register from "./components/Register";
import CompleteProfile from "./components/CompleteProfile";
import ResetPassword from "./components/ResetPassword";
import HomePage from "./components/HomePage";
import Booking from './components/Booking';
import MyBooking from './components/MyBookings';
import Profile from "./components/Profile";
import Navbar from "./components/Navbar";
import "./css/styles.css";

import { initializeApp } from "firebase/app";
import {
  getAuth,
  onAuthStateChanged
} from "firebase/auth";

const firebaseConfig = {
  apiKey: "AIzaSyDszpBw65FzuIrITEW53ydo0KM0jSIzNqg",
  authDomain: "carwash-b2a26.firebaseapp.com",
  projectId: "carwash-b2a26",
  storageBucket: "carwash-b2a26.appspot.com",
  messagingSenderId: "1993606131",
  appId: "1:1993606131:web:93ad9ed1e791e81d674886",
  measurementId: "G-4339HCF1BJ",
};

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem("token");
    onAuthStateChanged(auth, (user) => {
      setIsAuthenticated(!!user || !!token);
    });
  }, []);

  return (
    <Router>
      <Navbar isAuthenticated={isAuthenticated} />
      <Routes>
        <Route path="/" element={<App1 />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/reset-password/:token" element={<ResetPassword />} />

        {isAuthenticated && (
          <>
            <Route path="/profile" element={<Profile />} />
            <Route path="/bookings" element={<Booking />} />
            <Route path="/MyBookings" element={<MyBooking />} />
            <Route path="/homepage" element={<HomePage />} />
            <Route path="/complete-profile" element={<CompleteProfile />} />
          </>
        )}
      </Routes>
    </Router>
  );
}

export default App;
